import React, { useState } from 'react';
const Header = ({ text }) => {
  console.log({ text })
  return (
    <h1>{text}</h1>
  )
}
const MyButton = ({ onClick_func, text }) => {
  return (
    <button onClick={onClick_func} style={{ color: 'black', borderRadius: '5px' }}>{text}</button>
  );
};
const Mylabel = ({ text1, num, text2 }) => {
  return (
    <div>
      {text1} {num} {text2}
    </div>
  )
}
